import Layout from '../components/Layout';
import Link from 'next/link';
import RiverList from '../../components/RiversList';
import River from '../../components/River';

const RiverLink = props => (
    <li>
        <Link href="/p/[id]" as={`/p/${props.id}`}>
            <a>{props.id}</a>
        </Link>
        <Link href="../components/River" as={`/p/${props.name}`}>
            <a>{props.name}</a>
        </Link>
    </li>
);
const riverSearch = <div><h1>Popular White Water Rivers</h1>
    <ul>
        {/* <River/> */}
        <RiverLink id="Clackamas River, Upper" />
        <RiverLink id="Clackamas River, Lower" />
        <RiverLink id="North Santiam" />
        <RiverLink id="Deschutes" />
        <RiverLink id="Mckenzie" />
        <RiverLink id="John Day" />
        <RiverLink id="Rouge River" />
        <RiverLink id="Sandy" />
        <RiverLink id="White Salmon" />
        <RiverLink id="Canyon Creek" />
        <RiverLink id="Washougal" />
        <RiverLink id="Klikitat" />
        <RiverLink id="East Fork of the Lewis (EFL)" />
        <RiverLink id="Ohanapecosh (ohani)" />
        <RiverLink id="Upper Lewis Falls(waterfall)" />
        <RiverLink id="Molalla (Three bears)" />
        <RiverLink id="Wilson River" />
        <RiverLink id="Jordan Creek" />
        <RiverLink id="Wind" />
        <RiverLink id="Wynoochee" />

    </ul></div>;

export default function rivers() {
    return (
        <Layout content={riverSearch} />

    );
};
